insert  into `t_blog`(`id`,`title`,`summary`,`content`,`releaseDate`,`click`,`blogTypeId`,`isMenuBlog`,`setMenuBlogDate`) values (9,'idea快捷键大全','Ctrl：\n\n\n\n\n快捷键\n介绍\n\n\n\n\nCtrl + F\n在当前文件进行文本查找&nbsp;（必备）\n\n\nCtrl + R\n在当前文件进行文本替换&nbsp;（必备）\n\n\nCtrl + Z\n撤销&nbsp;（必备）\n\n\nCtrl + Y\n删除光标所在行 或 删除选中的行&nbsp;（必备）\n\n\nCtrl + X\n剪切光标所在行 或 剪切选择内容\n\n\nCtrl + C\n复制光标所在行 或 复制选择内容\n\n\nCtrl + D\n复制光标所在行 或 复制选择内容，并把复制内容插入光标位置下面&nbsp;（必备）\n\n\nCtrl + W\n递进式选择代码块。可选中光标所在的单词或段落，连续按会在原有选中的基础上再扩展选中范围&nbsp;（必备）\n\n\nCtrl + E\n显示最近打开的文件记录列表\n\n\nCtrl + N\n根据输入的&nbsp;类名&nbsp;查找类文件\n\n\nCtrl + G\n在当前文件跳转到指定行处\n\n\nCtrl + J\n插入自定义动态代码模板\n\n\nCtrl + P\n方法参数提示显示\n\n\nCtrl + Q\n光标所在的变量 / 类名 / 方法名等上面（也可以在提示补充的时候按），显示文档内容\n\n\nCtrl + U\n前往当前光标所在的方法的父类的方法 / 接口定义\n\n\nCtrl + B\n进入光标所在的方法/变量的接口或是定义出，等效于&nbsp;Ctrl + 左键单击\n\n\nCtrl +','<p><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\"><strong>Ctrl：</strong></span></span></p>\r\n\r\n<table border=\"1\">\r\n	<thead>\r\n		<tr>\r\n			<th style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">快捷键</span></span></th>\r\n			<th style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">介绍</span></span></th>\r\n		</tr>\r\n	</thead>\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Ctrl + F</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">在当前文件进行文本查找&nbsp;<code>（必备）</code></span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Ctrl + R</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">在当前文件进行文本替换&nbsp;<code>（必备）</code></span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Ctrl + Z</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">撤销&nbsp;<code>（必备）</code></span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Ctrl + Y</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">删除光标所在行 或 删除选中的行&nbsp;<code>（必备）</code></span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Ctrl + X</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">剪切光标所在行 或 剪切选择内容</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Ctrl + C</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">复制光标所在行 或 复制选择内容</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Ctrl + D</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">复制光标所在行 或 复制选择内容，并把复制内容插入光标位置下面&nbsp;<code>（必备）</code></span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Ctrl + W</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">递进式选择代码块。可选中光标所在的单词或段落，连续按会在原有选中的基础上再扩展选中范围&nbsp;<code>（必备）</code></span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Ctrl + E</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">显示最近打开的文件记录列表</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Ctrl + N</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">根据输入的&nbsp;<strong>类名</strong>&nbsp;查找类文件</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Ctrl + G</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">在当前文件跳转到指定行处</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Ctrl + J</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">插入自定义动态代码模板</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Ctrl + P</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">方法参数提示显示</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Ctrl + Q</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">光标所在的变量 / 类名 / 方法名等上面（也可以在提示补充的时候按），显示文档内容</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Ctrl + U</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">前往当前光标所在的方法的父类的方法 / 接口定义</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Ctrl + B</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">进入光标所在的方法/变量的接口或是定义出，等效于&nbsp;<code>Ctrl + 左键单击</code></span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Ctrl + K</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">版本控制提交项目，需要此项目有加入到版本控制才可用</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Ctrl + T</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">版本控制更新项目，需要此项目有加入到版本控制才可用</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Ctrl + H</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">显示当前类的层次结构</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Ctrl + O</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">选择可重写的方法</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Ctrl + I</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">选择可继承的方法</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Ctrl + +</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">展开代码</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Ctrl + -</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">折叠代码</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Ctrl + /</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">注释光标所在行代码，会根据当前不同文件类型使用不同的注释符号&nbsp;<code>（必备）</code></span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Ctrl + [</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">移动光标到当前所在代码的花括号开始位置</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Ctrl + ]</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">移动光标到当前所在代码的花括号结束位置</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Ctrl + F1</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">在光标所在的错误代码出显示错误信息</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Ctrl + F3</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">调转到所选中的词的下一个引用位置</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Ctrl + F4</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">关闭当前编辑文件</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Ctrl + F8</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">在 Debug 模式下，设置光标当前行为断点，如果当前已经是断点则去掉断点</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Ctrl + F9</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">执行 Make Project 操作</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Ctrl + F11</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">选中文件 / 文件夹，使用助记符设定 / 取消书签</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Ctrl + F12</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">弹出当前文件结构层，可以在弹出的层上直接输入，进行筛选</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Ctrl + Tab</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">编辑窗口切换，如果在切换的过程又加按上delete，则是关闭对应选中的窗口</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Ctrl + Enter</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">智能分隔行</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Ctrl + End</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">跳到文件尾</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Ctrl + Home</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">跳到文件头</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Ctrl + Space</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">基础代码补全，默认在 Windows 系统上被输入法占用，需要进行修改，建议修改为&nbsp;<code>Ctrl + 逗号</code>&nbsp;<code>（必备）</code></span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Ctrl + Delete</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">删除光标后面的单词或是中文句</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Ctrl + BackSpace</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">删除光标前面的单词或是中文句</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Ctrl + 1,2,3...9</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">定位到对应数值的书签位置</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Ctrl + 左键单击</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">在打开的文件标题上，弹出该文件路径</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Ctrl + 光标定位</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">按 Ctrl 不要松开，会显示光标所在的类信息摘要</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Ctrl + 左方向键</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">光标跳转到当前单词 / 中文句的左侧开头位置</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Ctrl + 右方向键</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">光标跳转到当前单词 / 中文句的右侧开头位置</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Ctrl + 前方向键</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">等效于鼠标滚轮向前效果</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Ctrl + 后方向键</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">等效于鼠标滚轮向后效果</span></span></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\"><strong>Alt：</strong></span></span></p>\r\n\r\n<table border=\"1\">\r\n	<thead>\r\n		<tr>\r\n			<th style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">快捷键</span></span></th>\r\n			<th style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">介绍</span></span></th>\r\n		</tr>\r\n	</thead>\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Alt + `</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">显示版本控制常用操作菜单弹出层</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Alt + Q</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">弹出一个提示，显示当前类的声明 / 上下文信息</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Alt + F1</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">显示当前文件选择目标弹出层，弹出层中有很多目标可以进行选择</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Alt + F2</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">对于前面页面，显示各类浏览器打开目标选择弹出层</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Alt + F3</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">选中文本，逐个往下查找相同文本，并高亮显示</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Alt + F7</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">查找光标所在的方法 / 变量 / 类被调用的地方</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Alt + F8</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">在 Debug 的状态下，选中对象，弹出可输入计算表达式调试框，查看该输入内容的调试结果</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Alt + Home</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">定位 / 显示到当前文件的&nbsp;<code>Navigation Bar</code></span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Alt + Enter</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">IntelliJ IDEA 根据光标所在问题，提供快速修复选择，光标放在的位置不同提示的结果也不同&nbsp;<code>（必备）</code></span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Alt + Insert</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">代码自动生成，如生成对象的 set / get 方法，构造函数，toString() 等</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Alt + 左方向键</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">按左方向切换当前已打开的文件视图</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Alt + 右方向键</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">按右方向切换当前已打开的文件视图</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Alt + 前方向键</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">当前光标跳转到当前文件的前一个方法名位置</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Alt + 后方向键</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">当前光标跳转到当前文件的后一个方法名位置</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Alt + 1,2,3...9</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">显示对应数值的选项卡，其中 1 是 Project 用得最多</span></span></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\"><strong>Shift：</strong></span></span></p>\r\n\r\n<table border=\"1\">\r\n	<thead>\r\n		<tr>\r\n			<th style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">快捷键</span></span></th>\r\n			<th style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">介绍</span></span></th>\r\n		</tr>\r\n	</thead>\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Shift + F1</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">如果有外部文档可以连接外部文档</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Shift + F2</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">跳转到上一个高亮错误 或 警告位置</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Shift + F3</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">在查找模式下，查找匹配上一个</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Shift + F4</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">对当前打开的文件，使用新Windows窗口打开，旧窗口保留</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Shift + F6</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">对文件 / 文件夹 重命名</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Shift + F7</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">在 Debug 模式下，智能步入。断点所在行上有多个方法调用，会弹出进入哪个方法</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Shift + F8</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">在 Debug 模式下，跳出，表现出来的效果跟&nbsp;<code>F9</code>&nbsp;一样</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Shift + F9</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">等效于点击工具栏的&nbsp;<code>Debug</code>&nbsp;按钮</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Shift + F10</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">等效于点击工具栏的&nbsp;<code>Run</code>&nbsp;按钮</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Shift + F11</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">弹出书签显示层</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Shift + Tab</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">取消缩进</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Shift + ESC</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">隐藏当前 或 最后一个激活的工具窗口</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Shift + End</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">选中光标到当前行尾位置</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Shift + Home</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">选中光标到当前行头位置</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Shift + Enter</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">开始新一行。光标所在行下空出一行，光标定位到新行位置</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Shift + 左键单击</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">在打开的文件名上按此快捷键，可以关闭当前打开文件</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Shift + 滚轮前后滚动</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">当前文件的横向滚动轴滚动</span></span></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\"><strong>Ctrl + Alt：</strong></span></span></p>\r\n\r\n<table border=\"1\">\r\n	<thead>\r\n		<tr>\r\n			<th style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">快捷键</span></span></th>\r\n			<th style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">介绍</span></span></th>\r\n		</tr>\r\n	</thead>\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Ctrl + Alt + L</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">格式化代码，可以对当前文件和整个包目录使用&nbsp;<code>（必备）</code></span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Ctrl + Alt + O</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">优化导入的类，可以对当前文件和整个包目录使用&nbsp;<code>（必备）</code></span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Ctrl + Alt + I</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">光标所在行 或 选中部分进行自动代码缩进，有点类似格式化</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Ctrl + Alt + T</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">对选中的代码弹出环绕选项弹出层</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Ctrl + Alt + J</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">弹出模板选择窗口，讲选定的代码加入动态模板中</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Ctrl + Alt + H</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">调用层次</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Ctrl + Alt + B</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">在某个调用的方法名上使用会跳到具体的实现处，可以跳过接口</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Ctrl + Alt + V</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">快速引进变量</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Ctrl + Alt + Y</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">同步、刷新</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Ctrl + Alt + S</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">打开 IntelliJ IDEA 系统设置</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Ctrl + Alt + F7</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">显示使用的地方。寻找被该类或是变量被调用的地方，用弹出框的方式找出来</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Ctrl + Alt + F11</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">切换全屏模式</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Ctrl + Alt + Enter</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">光标所在行上空出一行，光标定位到新行</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Ctrl + Alt + Home</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">弹出跟当前文件有关联的文件弹出层</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Ctrl + Alt + Space</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">类名自动完成</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Ctrl + Alt + 左方向键</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">退回到上一个操作的地方&nbsp;<code>（必备）<u><strong>（注意与其他软件快捷键冲突）</strong></u></code></span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Ctrl + Alt + 右方向键</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">前进到上一个操作的地方&nbsp;<code>（必备）<u><strong>（注意与其他软件快捷键冲突）</strong></u></code></span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Ctrl + Alt + 前方向键</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">在查找模式下，跳到上个查找的文件</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Ctrl + Alt + 后方向键</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">在查找模式下，跳到下个查找的文件</span></span></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\"><strong>Ctrl + Shift：</strong></span></span></p>\r\n\r\n<table border=\"1\">\r\n	<thead>\r\n		<tr>\r\n			<th style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">快捷键</span></span></th>\r\n			<th style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">介绍</span></span></th>\r\n		</tr>\r\n	</thead>\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Ctrl + Shift + F</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">根据输入内容查找整个项目 或 指定目录内文件&nbsp;<code>（必备）</code></span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Ctrl + Shift + R</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">根据输入内容替换对应内容，范围为整个项目 或 指定目录内文件&nbsp;<code>（必备）</code></span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Ctrl + Shift + J</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">自动将下一行合并到当前行末尾&nbsp;<code>（必备）</code></span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Ctrl + Shift + Z</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">取消撤销&nbsp;<code>（必备）</code></span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Ctrl + Shift + W</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">递进式取消选择代码块。可选中光标所在的单词或段落，连续按会在原有选中的基础上再扩展取消选中范围&nbsp;<code>（必备）</code></span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Ctrl + Shift + N</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">通过文件名定位 / 打开文件 / 目录，打开目录需要在输入的内容后面多加一个正斜杠&nbsp;<code>（必备）</code></span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Ctrl + Shift + U</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">对选中的代码进行大 / 小写轮流转换&nbsp;<code>（必备）</code></span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Ctrl + Shift + T</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">对当前类生成单元测试类，如果已经存在的单元测试类则可以进行选择</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Ctrl + Shift + C</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">复制当前文件磁盘路径到剪贴板</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Ctrl + Shift + V</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">弹出缓存的最近拷贝的内容管理器弹出层</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Ctrl + Shift + E</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">显示最近修改的文件列表的弹出层</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Ctrl + Shift + H</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">显示方法层次结构</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Ctrl + Shift + B</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">跳转到类型声明处</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Ctrl + Shift + I</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">快速查看光标所在的方法 或 类的定义</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Ctrl + Shift + A</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">查找动作 / 设置</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Ctrl + Shift + /</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">代码块注释&nbsp;<code>（必备）</code></span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Ctrl + Shift + [</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">选中从光标所在位置到它的顶部中括号位置</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Ctrl + Shift + ]</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">选中从光标所在位置到它的底部中括号位置</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Ctrl + Shift + +</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">展开所有代码</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Ctrl + Shift + -</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">折叠所有代码</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Ctrl + Shift + F7</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">高亮显示所有该选中文本，按Esc高亮消失</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Ctrl + Shift + F8</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">在 Debug 模式下，指定断点进入条件</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Ctrl + Shift + F9</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">编译选中的文件 / 包 / Module</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Ctrl + Shift + F12</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">编辑器最大化</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Ctrl + Shift + Space</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">智能代码提示</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Ctrl + Shift + Enter</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">自动结束代码，行末自动添加分号&nbsp;<code>（必备）</code></span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Ctrl + Shift + Backspace</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">退回到上次修改的地方</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Ctrl + Shift + 1,2,3...9</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">快速添加指定数值的书签</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Ctrl + Shift + 左方向键</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">在代码文件上，光标跳转到当前单词 / 中文句的左侧开头位置，同时选中该单词 / 中文句</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Ctrl + Shift + 右方向键</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">在代码文件上，光标跳转到当前单词 / 中文句的右侧开头位置，同时选中该单词 / 中文句</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Ctrl + Shift + 左方向键</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">在光标焦点是在工具选项卡上，缩小选项卡区域</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Ctrl + Shift + 右方向键</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">在光标焦点是在工具选项卡上，扩大选项卡区域</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Ctrl + Shift + 前方向键</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">光标放在方法名上，将方法移动到上一个方法前面，调整方法排序</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Ctrl + Shift + 后方向键</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">光标放在方法名上，将方法移动到下一个方法前面，调整方法排序</span></span></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\"><strong>Alt + Shift：</strong></span></span></p>\r\n\r\n<table border=\"1\">\r\n	<thead>\r\n		<tr>\r\n			<th style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">快捷键</span></span></th>\r\n			<th style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">介绍</span></span></th>\r\n		</tr>\r\n	</thead>\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Alt + Shift + N</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">选择 / 添加 task</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Alt + Shift + F</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">显示添加到收藏夹弹出层</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Alt + Shift + C</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">查看最近操作项目的变化情况列表</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Alt + Shift + F</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">添加到收藏夹</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Alt + Shift + I</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">查看项目当前文件</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Alt + Shift + F7</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">在 Debug 模式下，下一步，进入当前方法体内，如果方法体还有方法，则会进入该内嵌的方法中，依此循环进入</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Alt + Shift + F9</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">弹出&nbsp;<code>Debug</code>&nbsp;的可选择菜单</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Alt + Shift + F10</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">弹出&nbsp;<code>Run</code>&nbsp;的可选择菜单</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Alt + Shift + 左键双击</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">选择被双击的单词 / 中文句，按住不放，可以同时选择其他单词 / 中文句</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Alt + Shift + 前方向键</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">移动光标所在行向上移动</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Alt + Shift + 后方向键</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">移动光标所在行向下移动</span></span></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\"><strong>Ctrl + Shift + Alt：</strong></span></span></p>\r\n\r\n<table border=\"1\">\r\n	<thead>\r\n		<tr>\r\n			<th style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">快捷键</span></span></th>\r\n			<th style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">介绍</span></span></th>\r\n		</tr>\r\n	</thead>\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Ctrl + Shift + Alt + V</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">无格式黏贴</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Ctrl + Shift + Alt + N</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">前往指定的变量 / 方法</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Ctrl + Shift + Alt + S</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">打开当前项目设置</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Ctrl + Shift + Alt + C</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">复制参考信息</span></span></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\"><strong>其他：</strong></span></span></p>\r\n\r\n<table border=\"1\">\r\n	<thead>\r\n		<tr>\r\n			<th style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">快捷键</span></span></th>\r\n			<th style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">介绍</span></span></th>\r\n		</tr>\r\n	</thead>\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">F2</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">跳转到下一个高亮错误 或 警告位置&nbsp;<code>（必备）</code></span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">F3</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">在查找模式下，定位到下一个匹配处</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">F4</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">编辑源</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">F7</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">在 Debug 模式下，进入下一步，如果当前行断点是一个方法，则进入当前方法体内，如果该方法体还有方法，则不会进入该内嵌的方法中</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">F8</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">在 Debug 模式下，进入下一步，如果当前行断点是一个方法，则不进入当前方法体内</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">F9</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">在 Debug 模式下，恢复程序运行，但是如果该断点下面代码还有断点则停在下一个断点上</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">F11</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">添加书签</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">F12</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">回到前一个工具窗口</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">Tab</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">缩进</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">ESC</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">从工具窗口进入代码文件窗口</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">连按两次Shift</span></span></td>\r\n			<td style=\"text-align:center\"><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">弹出&nbsp;<code>Search Everywhere</code>&nbsp;弹出层</span></span></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n','2020-10-10 00:41:50',195,5,0,NULL),(11,'Java环境配置','1.安装JDK\n\n2.配置Java环境(右击&quot;我的电脑&quot;，点击&quot;属性&quot;，选择&quot;高级系统设置&quot;)\n\n①变量名:\n\n\n\nJAVA_HOME\n\n\n\n变量值:\n\n\n\nF:\\java\\jdk1.8.0_92\n \n\n\n\n\n本地JDK安装路径\n\n②变量名:\n\n\n\nclasspath\n\n\n\n变量值:\n\n\n\n.;%JAVA_HOME%\\lib\\dt.jar;%JAVA_HOME%\\lib\\tools.jar \n\n\n\n\n\n③变量名:\n\n\n\nPath\n\n\n\n变量值:\n\n\n\nF:\\java\\jdk1.8.0_92\\bin\nF:\\java\\jre\\bin\n\n\n\n\n\n3.测试JDK是否安装成功\n\n①&quot;开始&quot;-&gt;&quot;运行&quot;，键入&quot;cmd&quot;；\n\n②键入命令:&nbsp;java -version、java、javac&nbsp;几个命令，出现以下信息，说明环境变量配置成功；\n\n\n\n\n\n\n','<p><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\"><strong>1.安装JDK</strong></span></span></p>\r\n\r\n<p><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\"><strong>2.配置Java环境(右击&quot;我的电脑&quot;，点击&quot;属性&quot;，选择&quot;高级系统设置&quot;)</strong></span></span></p>\r\n\r\n<p><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">①变量名:</span></span></p>\r\n\r\n<pre>\r\n<span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\"><code>\r\nJAVA_HOME\r\n</code>\r\n</span></span></pre>\r\n\r\n<p><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">变量值:</span></span></p>\r\n\r\n<pre>\r\n<span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\"><code>\r\nF:\\java\\jdk1.8.0_92\r\n </code>\r\n</span></span></pre>\r\n\r\n<p><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\"><strong><img alt=\"\" src=\"/static/images/blogImage/20201010123055.jpg\" style=\"height:170px; width:666px\" /></strong></span></span></p>\r\n\r\n<p><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">本地JDK安装路径</span></span></p>\r\n\r\n<p><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">②变量名:</span></span></p>\r\n\r\n<pre>\r\n<span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\"><code>\r\nclasspath\r\n</code>\r\n</span></span></pre>\r\n\r\n<p><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\">变量值:</span></span></p>\r\n\r\n<pre>\r\n<span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:15px\"><code>\r\n.;%JAVA_HOME%\\lib\\dt.jar;%JAVA_HOME%\\lib\\tools.jar \r\n</code>\r\n</span></span></pre>\r\n\r\n<p><spa